import { type } from "os";

// 详情模块数据类型
export interface ResponseData {
  code: number;
  message: string;
  ok: boolean;
}

export interface HosPitalDetail {
  bookingRule: {
    cycle: number;
    releaseTime: string;
    stopTime: string;
    quitDay: number;
    quitTime: string;
    rule: string[];
  };
  hospital: {
    id: string;
    createTime: string;
    updateTime: string;
    isDeleted: number;
    param: {
      hostypeString: string;
      fullAddress: string;
    };
    hoscode: string;
    hosname: string;
    hostype: string;
    provinceCode: string;
    cityCode: string;
    districtCode: string;
    address: string;
    logoData: string;
    intro: null;
    route: string;
    status: number;
    bookingRule: null;
  };
}

// 返回数据
export interface HospitalDetail extends ResponseData {
  data: HosPitalDetail;
}

// 科室数据
export interface Deparment {
  depcode: string;
  depname: string;
  children?: Deparment[];
}

export type DeparmentArr = Deparment[];

// 返回数据类型
export interface DeparmentResponseData extends ResponseData {
  data: DeparmentArr;
}

//登录
export interface LoginData {
  phone: string;
  code: string;
}

// 登录接口返回数据类型
export interface UserInfo {
  name: string;
  token: string;
}
export interface UserLoginResponseData extends ResponseData {
  data: UserInfo;
}
